      setThemeLight(!themeLight);
    };

    return(
       <header>
            <h1 className="head">T O D O</h1>
            <div className="theme"><img src={ SwitchToLightIcon} alt="icon-sun" className="themeicon" /></div>
       </header>
    );
}
